import React, { useState } from 'react';
import axios from 'axios';
import PesquisaAtleta from './components/PesquisarAtletas';
import PainelFavoritos from './PainelFavoritos';

function App() {
  const [favoritos, setFavoritos] = useState([]);

  const addToFavorites = (atleta) => {
    setFavoritos([...favoritos, atleta]);
  };

  return (
    <div className="App">
      <PesquisaAtleta onAddToFavorites={addToFavorites} />
      <PainelFavoritos favoritos={favoritos} />
    </div>
  );
}

export default App;
